import * as React from "react";
import { List, Datagrid, TextField , DateField, EmailField} from 'react-admin';


const FullNameField = ({ record = {} }) => <span>{record.gender ? "男性" : (record.gender == false ? "女性" : "なし")}</span>;
FullNameField.defaultProps = { label: '性別' };

export const UsersList = (props) => {

    return(
    <List {...props} title="Users List">
        <Datagrid>
            <TextField source="firstName" label="お名前"/>
            <EmailField source="email" />
            <DateField source="dateOfBirth" />
            <TextField source="phoneNumber" />
            <TextField source="address" />
            <FullNameField source="gender" />
        </Datagrid>
    </List>
	)}
;
